import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 5.25C3 4 4 3 5.25 3h2.5C9 3 10 4 10 5.25v2.5C10 9 9 10 7.75 10h-.5v3.7l.13.12 2.8 2.8.11.13H14v-.5c0-1.24 1.01-2.25 2.25-2.25h2.5c1.24 0 2.25 1 2.25 2.25v2.5C21 20 20 21 18.75 21h-2.5C15.01 21 14 20 14 18.75v-.5H10.3c-.03.05-.07.1-.12.13l-2.79 2.8c-.48.48-1.28.48-1.76 0l-2.8-2.8a1.25 1.25 0 010-1.76l2.8-2.8.13-.11V10h-.5C4 10 3 9 3 7.74v-2.5z", fill: primaryFill }));
};
const Flowchart24Filled = wrapIcon(rawSvg({}), 'Flowchart24Filled');
export default Flowchart24Filled;
